import React from "react";

const FooterComponent = () => {
  return (
    <div>
      <footer className="footer">
        <span className="text-muted">
          All Rights Reserved 2024 @MinalMeshram
        </span>
      </footer>
    </div>
  );
};

export default FooterComponent;
